import React, { useEffect, useState } from "react";
import { useParams, useLocation } from "react-router";
import "./resultcss/result.css";
import TablePopup from "./components/tablePopup";
import axios from "axios";
const [shareButton, setShareButton] = useState(false);
// result.css 1712
function exportHTML(emptyArr, setPopup, setPopupName) {
  var list = [];
  var len = 0;
  var h = "30px";
  var t = "";
  var class_name;
  var dif = -1;
  var first = true;
  var html;

  for (var i = 0; i < emptyArr.length; i++) {
    t = (i * 30).toString() + "px";
    if (i != 0) dif = emptyArr[i - 1].length;
    len = emptyArr[i].length;
    if (dif != len) first = true;
    else first = false;
    class_name = "subject color" + (len + 1).toString();

    let names = "";

    if (len != 0) {
      for (let name of emptyArr[i]) {
        names = names + name + ",";
      }
      names = names.substring(0, names.length - 1);
    } else {
      names = "모두 불가능한 시간!";
    }

    if (first == true)
      html = (
        <>
          <br></br>
          <p>
            <em>{len.toString()}명가능</em>
          </p>
        </>
      );
    else html = <></>;

    list.push(
      <div
        class={class_name}
        style={{ height: h, top: t }}
        onClick={() => {
          setPopup(true);
          setPopupName(names);
        }}
      >
        {html}
      </div>
    );
  }
  return list;
}

const Result = (props) => {
